import React, { Component } from 'react'

class App extends Component{


  increase(){
    document.querySelector('num span')
  }

  render(){

    var num = 1
    return(
      <div>
        <div id="num">
          test No. <span>{num}</span> 
        </div>
        <button onClick={this.increase(num)}>Click</button>
      </div>
    )
  }
}


export default App
